import React, { Component } from "react";

class Games extends Component {
  state = {};
  render() {
    return (
      <div className="container">
        <div className="row">
          <h1 className="text-center text-primary">Games Data</h1>
          <table className="table table-bordered">
            <thead>
              <tr>
                <th>Date</th>
                <th>Game Id</th>
                <th>Player</th>
                <th>Profit/Loss</th>
                <th>Nom of pritot</th>
                <th>Is App</th>
                <th>Payed debt</th>
                <th>Name of Nispach</th>
              </tr>
            </thead>
            <tbody></tbody>
          </table>
        </div>
      </div>
    );
  }
}

export default Games;
